import React from "react";
import "../CSS/History.css";
import { useState } from "react";
function History() {
    const [id, setID] = useState(1);
    const [date, setDate] = useState("");
    const [symbol, setSymbol] = useState("");
    const [buy, setBuy] = useState("");
    const [sell, setSell] = useState("");
    const [shares, setShares] = useState("");
    const [time, setTime] = useState("");
    const [note, setNote] = useState("");

    const addItem = async () => {
        const raw = {
            id: id,
        };

        const requestOptions = {
            method: "POST",
            headers: { "Content-Type": "application/json" },
            body: JSON.stringify(raw),
        };

        await fetch(" http://localhost:8000/chart", requestOptions);
        setID(id + 1);
    };
    return (
        <div className="HistoryPage">
            <input
                className="date-history"
                placeholder="Date"
                onChange={(e) => {
                    setDate(e.target.value);
                }}
            />
            <input
                className="symbol-history"
                placeholder="Ticker"
                onChange={(e) => {
                    setSymbol(e.target.value);
                }}
            />
            <input className="buy-history" placeholder="Buy Price" />
            <input className="sell-history" placeholder="Sell Price" />
            <input className="shares-history" placeholder="Shares" />
            <input className="time-history" placeholder="Total Time" />
            <textarea className="note-history" placeholder="Enter Note...." />
            <button className="submit-history" onClick={addItem}>
                Submit
            </button>
        </div>
    );
}

export default History;
